import React, { useState } from "react";

function InterviewPreparation() {
  const [pdfFile, setPdfFile] = useState(null);

  // ‚úÖ If a PDF is selected, show PDF iframe with Back button
  if (pdfFile) {
    return (
      <div
        style={{
          backgroundColor: "#0f172a",
          minHeight: "100vh",
          padding: "20px",
          color: "white",
        }}
      >
        <button
          onClick={() => setPdfFile(null)}
          style={{
            marginBottom: "15px",
            padding: "8px 16px",
            backgroundColor: "#fbbf24",
            color: "black",
            fontWeight: "bold",
            borderRadius: "8px",
            cursor: "pointer",
            border: "none",
          }}
        >
          ‚¨Ö Back
        </button>

        <iframe
          src={pdfFile}
          title="PDF Viewer"
          style={{ width: "100%", height: "90vh", border: "none" }}
        />
      </div>
    );
  }

  // ‚úÖ Main page with cards
  return (
    <div
      style={{
        backgroundColor: "#0f172a",
        minHeight: "100vh",
        color: "white",
        padding: "20px",
      }}
    >
      {/* Header */}
      <header
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          gap: "15px",
          marginBottom: "40px",
        }}
      >
        <img
          src="/images/ppklogo.jpg"
          alt="Placement Preparation Kit Logo"
          style={{
            width: "100px",
            height: "70px",
            objectFit: "contain",
            boxShadow: "0 0 20px gold",
          }}
        />
        <div style={{ textAlign: "center" }}>
          <h1
            style={{
              fontSize: "36px",
              fontWeight: "bold",
              background: "linear-gradient(90deg, #FFD700, #FFA500, #FFD700)",
              WebkitBackgroundClip: "text",
              WebkitTextFillColor: "transparent",
              textShadow: "0 0 15px rgba(255,215,0,0.8)",
            }}
          >
            Interview Preparation
          </h1>
          <p
            style={{
              fontSize: "18px",
              color: "#9CA3AF",
              marginTop: "10px",
            }}
          >
            Master HR, Technical, Mock Interviews & Resume Prep ‚Äî all in one place!
          </p>
        </div>
      </header>

      {/* Cards Section */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(260px, 1fr))",
          gap: "25px",
          padding: "0 10px",
        }}
      >
        {/* HR Interview Prep */}
        <div
          style={{
            background: "#1e293b",
            padding: "20px",
            borderRadius: "14px",
            border: "2px solid #f472b6",
            boxShadow: "0 0 20px #f472b6",
            cursor: "pointer",
          }}
        >
          <h2 style={{ color: "#f472b6", fontSize: "22px", marginBottom: "15px", textDecoration: "underline" }}>
            üíº HR Interview Prep
          </h2>
          <ul style={{ lineHeight: "1.8" }}>
            <li>
              <button
                onClick={() => setPdfFile("/pdf/TOPHRQUES.pdf")}
                style={{ color: "#f472b6", background: "none", border: "none", cursor: "pointer" }}
              >
                Top HR Questions And Answering Strategies
              </button>
            </li>
          </ul>
        </div>

        {/* Technical Q&A Bank */}
        <div
          style={{
            background: "#1e293b",
            padding: "20px",
            borderRadius: "14px",
            border: "2px solid #38bdf8",
            boxShadow: "0 0 20px #38bdf8",
            cursor: "pointer",
          }}
        >
          <h2 style={{ color: "#38bdf8", fontSize: "22px", marginBottom: "15px", textDecoration: "underline" }}>
            ‚öôÔ∏è Technical Q&A
          </h2>
          <ul style={{ lineHeight: "1.8" }}>
            <li>
              <button
                onClick={() => setPdfFile("/pdf/DSAQUES.pdf")}
                style={{ color: "#38bdf8", background: "none", border: "none", cursor: "pointer" }}
              >
                DSA & Coding Qs
              </button>
            </li>
            <li>
              <button
                onClick={() => setPdfFile("/pdf/CSCORE.pdf")}
                style={{ color: "#38bdf8", background: "none", border: "none", cursor: "pointer" }}
              >
                Core CS Concepts
              </button>
            </li>
          </ul>
        </div>

        {/* Mock Interviews */}
        <div
          style={{
            background: "#1e293b",
            padding: "20px",
            borderRadius: "14px",
            border: "2px solid #a78bfa",
            boxShadow: "0 0 20px #a78bfa",
            cursor: "pointer",
          }}
        >
          <h2 style={{ color: "#a78bfa", fontSize: "22px", marginBottom: "15px", textDecoration: "underline" }}>
            üé§ Mock Interviews
          </h2>
          <ul style={{ lineHeight: "1.8" }}>
            <li>
              <a href="#" style={{ color: "#a78bfa", textDecoration: "none" }}>
                AI-Powered Practice
              </a>
            </li>
            <li>
              <a href="#" style={{ color: "#a78bfa", textDecoration: "none" }}>
                Peer-to-Peer Mock
              </a>
            </li>
          </ul>
        </div>

        {/* Resume & Company Prep */}
        <div
          style={{
            background: "#1e293b",
            padding: "20px",
            borderRadius: "14px",
            border: "2px solid #facc15",
            boxShadow: "0 0 20px #facc15",
            cursor: "pointer",
          }}
        >
          <h2 style={{ color: "#facc15", fontSize: "22px", marginBottom: "15px", textDecoration: "underline" }}>
            üìÑ Resume & Company Prep
          </h2>
          <ul style={{ lineHeight: "1.8" }}>
            <li>
              <button
                onClick={() => setPdfFile("/pdf/ResumeBuild.pdf")}
                style={{ color: "#facc15", background: "none", border: "none", cursor: "pointer" }}
              >
                Resume Building Guide
              </button>
            </li>
            <li>
              <button
                onClick={() => setPdfFile("/pdf/COMPANYFAQS.pdf")}
                style={{ color: "#facc15", background: "none", border: "none", cursor: "pointer" }}
              >
                Company FAQs
              </button>
            </li>
          </ul>
        </div>
      </div>

      <p
        style={{
          textAlign: "center",
          marginTop: "50px",
          fontSize: "18px",
          fontWeight: "bold",
          color: "#fbbf24",
        }}
      >
        üöÄ Get Ready, Get Confident, Get Placed!
      </p>
    </div>
  );
}

export default InterviewPreparation;
